import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const KeepData = (props) => {
    return (
        <>
            {props.value.map((values , index) => {
                return (
                    <div className = "container">
                    <div className = "row">
                    <div className = "col-3">
                    <h4>{values}</h4>
                    </div>
                    </div>
                    </div>
                )
            })}
        </>
    );
}
export default KeepData;
